import React from 'react';
import './App.css';
import Footer from './components/Footer'
import Header from './components/Header'
import MainContent from './MainContent'

function App() {
  return (
    <div className="App">
      <Header />
      <MainContent />
      <Footer />
    </div>
  );
}

export default App;
